     <style type="text/css">
            body{
                background: #000000;
                padding: 0px;
                margin: 0px;
            }
            img{
                display:block;
                margin: 0;
                position: absolute;
                top: 50%;
                left: 50%;
                transform: translate(-50%, -50%);
            }

            /* Loading Spinner */
            .lds-dual-ring {
              display: inline-block;
              width: 64px;
              height: 64px;
              position: absolute;
              left: 50%;
              top: 50%;
              z-index: 1;
              margin: -32px 0 0 -32px;
            }
            .lds-dual-ring:after {
              content: " ";
              display: block;
              width: 46px;
              height: 46px;
              margin: 1px;
              border-radius: 50%;
              border: 5px solid #fff;
              border-color: #fff transparent #fff transparent;
              animation: lds-dual-ring 1.2s linear infinite;
            }
            @keyframes lds-dual-ring {
              0% {
                transform: rotate(0deg);
              }
              100% {
                transform: rotate(360deg);
              }
            }
            /* Loading Spinner End */

<script type="text/javascript">
var game = null;

var dapiMode = typeof(dapi) !== 'undefined';
var mRaidMode = typeof(mraid) !== 'undefined';
var googleMode = typeof(google) !== 'undefined';
var tapjoyMode = typeof(tapjoy) !== 'undefined';
var facebookMode = typeof(facebook) !== 'undefined';
var vungleMode = typeof(vungle) !== 'undefined';
var mintegralMode = typeof(mintegral) !== 'undefined';

console.log("dapi: " + dapiMode);
console.log("mRaidMode: " + mRaidMode);
console.log("googleMode: " + googleMode);
console.log("tapjoyMode: " + tapjoyMode);
console.log("facebookMode: " + facebookMode);
console.log("vungleMode: " + vungleMode);
console.log("mintegralMode: " + mintegralMode);


if(tapjoyMode)
{
    (window.TJ_API && window.TJ_API.setPlayableBuild(tapjoy.version));

    if(window.TJ_API)
    {
        window.TJ_API.setPlayableAPI({skipAd: function() 
        {
        } });
    }else
    {
        window.onkeyup = function(keyEvent) 
        {
        };

    }
}

/* mintegral */
            
function gameStart()
{
    start();
}

function gameClose()
{

}

/* mintegral end */


if( mRaidMode && mraid.getState() === 'loading')
{
    mraid.addEventListener('ready', start);
}

window.onload = function()
{
    if(dapiMode)
    {
        if(dapi.isReady())
        {
            dapiOnReadyCallback();
        }else
        {
            dapi.addEventListener("ready", dapiOnReadyCallback);
        }

    }else
    {
        start();
    }

    resizeUpdate();
}

function dapiOnReadyCallback()
{
    //No need to listen to this event anymore
    //dapi.removeEventListener("ready", onReadyCallback);

    //If the ad is visible start the game
    if(dapi.isViewable())
    {
        start();
    } 
    //Use dapi functions
    dapi.addEventListener("viewableChange", viableChanged);
    dapi.addEventListener("adResized", start);
    dapi.addEventListener("audioVolumeChange", dapiOnAudioVolumeChange);
}

function dapiOnAudioVolumeChange()
{

}

function viableChanged()
{
    if(dapi.isViewable())
    {
        start();
    }else
    {
        // STOP SOUNDS
    }
}

function start()
{
    document.body.style.backgroundColor = "#bdbcd7";
    document.getElementById("loader").style.visibility = "hidden";

    document.onclick = function() 
    {
        playableCompleted();
        goToStore();
    };


    var gif = document.getElementById("gif");
    gifWidth = gif.naturalWidth;
    gifHeigth = gif.naturalHeight;
    gif.addEventListener('load', function() 
    {
        gifWidth = this.naturalWidth;
        gifHeigth = this.naturalHeight;
    });

    if(mRaidMode)
    {
        mraid.addEventListener('viewableChange', resize);
    }else if(dapiMode)
    {
        if(dapi.isReady())
        {
            var audioVolume = dapi.getAudioVolume();
        }
    }

    onTexturesLoad();
    tapjoyError();

    resize();
    window.addEventListener("resize", resize, false);

}

function getScreenSize() 
{
    var e = window,
        t = document,
        r = t.documentElement,
        n = t.body;
    return {
        width: e.innerWidth || r.clientWidth || n.clientWidth,
        height: e.innerHeight || r.clientHeight || n.clientHeight
    }
}


var gifWidth = 700;
var gifHeigth = 1024;


var oldWindowWith = 0;
var oldWindowHeight = 0;

var oldGifWidth = 0;
var oldGifHeight = 0;


function resize() 
{
    var img = document.querySelector("img");
    var screenSize = getScreenSize();
    var windowWidth = screenSize.width;
    var windowHeight = screenSize.height;


    if(mRaidMode)
    {
        var screenSize = mraid.getScreenSize();
        windowWidth = screenSize.width;
        windowHeight = screenSize.height;

    }else if(dapiMode)
    {
        var screenSize = dapi.getScreenSize();
        windowWidth = screenSize.width;
        windowHeight = screenSize.height;
    }else if(vungleMode)
    {
        windowWidth = document.body.clientWidth;
        windowHeight = document.body.clientHeight;
    }

    if(windowWidth == oldWindowWith && windowHeight == oldWindowHeight)
    {
        return;
    }

    oldWindowWith = windowWidth;
    oldWindowHeight = windowHeight;

    oldWindowWith = gifWidth;
    oldGifHeight = gifHeigth;

    var windowRatio = windowWidth / windowHeight;
    var gifRatio = gifWidth / gifHeigth;

    if(windowRatio < gifRatio){
        img.style.width = windowWidth + "px";
        img.style.height = (windowWidth / gifRatio) + "px";
    }
    else{
        img.style.width = (windowHeight * gifRatio) + "px";
        img.style.height = windowHeight + "px";
    }
}

function resizeUpdate()
{
    resize();
    window.requestAnimationFrame(resizeUpdate);
}

function goToStore()
{
    if(mRaidMode)
    {
        /* APPLOVIN */
        var userAgent = navigator.userAgent || navigator.vendor;
        if(/android/i.test(userAgent))
        {
            mraid.open("https://play.google.com/store/apps/details?id=com.dalakgames.ziplinevalley");
        }else
        {
            mraid.open("https://itunes.apple.com/us/app/zipline-valley/id1470146913");
        }
    }else if(dapiMode)
    {
        /* IRON SOURCE */
        dapi.openStoreUrl();
    }else if(googleMode)
    {
        /* GOOGLE */
        window.open(window.clickTag);
    }else if(tapjoyMode)
    {
        window.TJ_API && window.TJ_API.click();
    }else if(facebookMode)
    {
        FbPlayableAd.onCTAClick();
    }else if(vungleMode)
    {
        parent.postMessage('download', '*');

    }else if(mintegralMode)
    {
        window.install && window.install();
    }else
    {
        console.log("GO TO STORE");
    }
}

function playableCompleted()
{
        if(tapjoyMode)
        {
            window.TJ_API && window.TJ_API.gameplayFinished();
            window.TJ_API && window.TJ_API.objectiveComplete();
        }

        if(vungleMode)
        {
            parent.postMessage('complete', '*');
        }

        if(mintegralMode)
        {
            window.gameEnd && window.gameEnd();
        }
}

function tapjoyError()
{
    if(tapjoyMode)
    {
      var userAgent = navigator.userAgent || navigator.vendor;
      var iOS = /iPad|iPhone|iPod/.test(userAgent) && !window.MSStream;
      var android = /android/i.test(userAgent);
      if(!iOS && !android)
      {
          window.TJ_API && window.TJ_API.error("Not Mobile");
      }
    }
}

function onTexturesLoad()
{
    console.log("Texture Loading Complete"); /* do something with the texture */ 
    if(mintegralMode)
    {
        window.gameReady && window.gameReady();
    }
}
